function getSSIDList(){var e="/cgi-bin/getSSIDList.cgi",t=new XMLHttpRequest;t.open("GET",e,!1),t.send(null);var n=t.responseText;return n.split(",")}function renderSSIDDropDownList(){$("#ssid-list-container").html(function(){$("#ssid-list-base > label").text("Select SSID"),$("#ssid-list-base > input").removeAttr("disabled");for(var e="",t=getSSIDList(),n=0;n<t.length;n++)e+="<li>"+t[n]+"</li>";if(""!=e)return e})}function httpGET(e){var t=new XMLHttpRequest;return t.open("GET",e,!0),t.send(null),e+" "+t.responseText}function saveWiFiSettings(){var e="/cgi-bin/saveWiFiConfig.cgi?"+document.getElementById("username").value+";"+document.getElementById("password").value;document.getElementById("info-div").innerHTML=httpGET(e)}function saveBTSettings(){var e="/cgi-bin/saveBTConfig.cgi";document.getElementById("info-div").innerHTML="BT Paired"+httpGET(e)}function restartRenderer(){var e="/cgi-bin/restartRenderer.cgi";document.getElementById("info-div").innerHTML="Restart Renderer"+httpGET(e)}function rescanDrives(){var e="/cgi-bin/rescanDrives.cgi";document.getElementById("info-div").innerHTML="Rescan Drives"+httpGET(e)}function updateTextBox(){var e=document.getElementById("selectWifi");e.options.length>0||0==e.options[e.selectedIndex].value?document.getElementById("username").value=e.options[e.selectedIndex].text:e.options.length<0&&window.alert("Select box is empty")}